        int24 tickUpper;
        uint32 poolID;
        address token1;
        uint256 amount0Min;
        uint256 amount1Min;
    }

    struct LiquidateParams {
        uint32 poolID;
        address token0;
        address token1;
        uint128 liquidity;
        uint256 position;
        uint256 decreaseAmount0Min;
        uint256 decreaseAmount1Min;
    }

    struct SwapParams {
        uint160 sqrtPriceLimitX96;
        address tokenIn;
        address tokenOut;
        uint24 fee;
        uint256 amountIn;
        uint256 amountOutMinimum;
    }

    struct RebalanceParams {
        uint256 amount0Desired;
        uint256 amount1Desired;
        uint256 amount0;
        uint256 amount1;
    }

    struct DonateParams {
        uint32 poolID;
        uint256 amount;
    }

    /// Events
    event PoolCreated(uint32 poolID);
    event YieldReceived(uint256 amount, address token, uint32 poolID);

    /// Functions
    function createPool() external;

    function donate(DonateParams[] calldata params) external;

    function enterPosition(EnterParams calldata params) external;

    /// @notice Changes the composition of deposits in preparation of a deploy
    /// @param poolID The pool to change
    /// @param params The swap parameters
    function rebalancePool(uint32 poolID, SwapParams calldata params) external;

    function exitPosition(CloseParams calldata params) external;

    function harvestYieldByPool(
        uint32 poolID,
        SwapParams calldata token0Params,
        SwapParams calldata token1Params
    ) external;

    function manualWithdraw(
        uint32 poolID,
        address token,
        uint256 amount,
        uint256 amount0Min,
        uint256 amount1Min
    ) external;

    function getPoolBalance(uint32 poolID) external view returns (uint256 tokenA, uint256 tokenB);

    function getPendingYield(uint32 poolId) external view returns (address[] memory tokens, uint256[] memory amounts);

    function getPendingYieldBurn(uint32 poolId) external returns (address[] memory tokens, uint256[] memory amounts);

    function getRawPoolData(uint32 poolID)
        external
        view
        returns (
            address token0,
            address token1,
            uint24 fee,
            int24 tickLower,
            int24 tickUpper,
            uint128 liquidity,
            uint128 tokensOwed0,
            uint128 tokensOwed1
        );

    /// Autogenerated getter function definitions
    function availableYield(uint32 poolID, address token) external view returns (uint256 amount);

    function positionID(uint32 poolID) external view returns (uint256 id);
}
