/**
 * RULES
 * - when we burn liquidity, we always withdraw the principal and leave the fees
 * - when we claim fees, we know all the tokens we collect are fees
 * - in other words, calling "collect" will always pull only fees unless we have just performed a liquidity burn
 */
contract DROIntegration is
    Initializable,
    ModuleMapConsumer,
    Controlled,
    IAMMIntegration,
    IUniswapV3Integration,
    IERC721Receiver,
    IDROIntegration
{
    /// Libraries
    using SafeERC20 for IERC20;

    /// State variables
    INonfungiblePositionManager public positionManager;

    IUniswapV3Factory public factory;

    IUniswapV3SwapRouter public swapRouter;

    uint32 public override poolIDCounter;

    // Pool ID => token address => balance held within this contract
    mapping(uint32 => mapping(address => uint256)) public override balances;

    // Pool ID => Current position (nft) ID for the pool
    mapping(uint32 => uint256) public override positionID;

    // Pool ID => token address => balance of yield available to be transferred out of the integration
    mapping(uint32 => mapping(address => uint256)) public override availableYield;

    /// Functions
    function initialize(
        address[] memory controllers_,
        address moduleMap_,
        address nonfungiblePositionManager_,
        address uniswapFactory_,
        address swapRouter_
    ) public initializer {
        require(nonfungiblePositionManager_ != address(0), "bad address");
        require(uniswapFactory_ != address(0), "bad address");
        require(swapRouter_ != address(0), "bad address");
        __Controlled_init(controllers_, moduleMap_);
        positionManager = INonfungiblePositionManager(nonfungiblePositionManager_);
        swapRouter = IUniswapV3SwapRouter(swapRouter_);
        factory = IUniswapV3Factory(uniswapFactory_);
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes calldata
    ) external pure override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    /// IAMMInterface Functions
    function deposit(
        address token,
        uint256 amount,
        uint32 poolID
    ) external override onlyController {
        require(poolID <= poolIDCounter, "invalid pool");
        require(token != address(0), "bad address");
        balances[poolID][token] += amount;
    }

