    function deploy(uint32) external view override onlyController {
        // No mev protection. It's here to satisfy the interface, not to actually be used.
        return;
    }

    function donate(DonateParams[] calldata params) external override {
        address weth = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();
        uint256 total;
        uint256 length = params.length;
        for (uint256 i; i < length; ++i) {
            availableYield[params[i].poolID][weth] += params[i].amount;
            total += params[i].amount;
        }
        IERC20(weth).safeTransferFrom(msg.sender, address(this), total);
    }

    function harvestYield() external override onlyController {
        address yieldManager = moduleMap.getModuleAddress(Modules.YieldManager);
        address weth = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();
        for (uint32 i = 1; i <= poolIDCounter; i++) {
            uint256 yieldAmount = availableYield[i][weth];
            if (yieldAmount != 0) {
                availableYield[i][weth] = 0;
                IERC20(weth).safeTransfer(yieldManager, yieldAmount);
                emit YieldReceived(yieldAmount, weth, i);
            }
        }
    }

    /// Management functions
    function updateBalance(
        uint32 poolID,
        address token,
        uint256 amount,
        bool add
    ) external onlyManager {
        if (add) {
            balances[poolID][token] += amount;
        } else {
            balances[poolID][token] -= amount;
        }
    }

    function manualDeploy(
        uint32 poolID,
        uint256 amount0Desired,
        uint256 amount1Desired,
        uint256 amount0Min,
        uint256 amount1Min
    ) external onlyManager {
        require(poolID <= poolIDCounter, "Invalid pool");

        uint256 tokenId = positionID[poolID];
        require(tokenId > 0, "Pool position invalid");

        (, , address token0, address token1, , , , , , , , ) = positionManager.positions(positionID[poolID]);
        require(balances[poolID][token0] >= amount0Desired, "insufficient amount 0");
        require(balances[poolID][token1] >= amount1Desired, "insufficient amount 1");

        // Increase liquidity of existing position
        (, uint256 amount0, uint256 amount1) = positionManager.increaseLiquidity(
            INonfungiblePositionManager.IncreaseLiquidityParams(
                tokenId,
                amount0Desired,
                amount1Desired,
                amount0Min,
                amount1Min,
                block.timestamp
            )
        );
        // Update balances
        balances[poolID][token0] -= amount0;
        balances[poolID][token1] -= amount1;
    }

    function rebalancePool(uint32 poolID, SwapParams calldata params) external override onlyManager {
        // Swaps the currently deposited funds into the correct range
        require(poolID <= poolIDCounter, "Invalid pool");

        require(balances[poolID][params.tokenIn] >= params.amountIn, "insufficient amount in");
        uint256 balanceA = balances[poolID][params.tokenIn];
        uint256 balanceB = balances[poolID][params.tokenOut];

        // Swap out
        uint256 amountOut = _swapExactInput(params);

        balanceA -= params.amountIn;
        balanceB += amountOut;
        balances[poolID][params.tokenIn] = balanceA;
        balances[poolID][params.tokenOut] = balanceB;
    }

    function manualWithdraw(
        uint32 poolID,
        address token,
        uint256 amount,
        uint256 amount0Min,
        uint256 amount1Min
    ) external override onlyManager {
        require(poolID <= poolIDCounter && poolID > 0, "Invalid pool");
        require(token != address(0), "invalid token");

        // Pull liquidity to fill the amount out
        (, , address token0, address token1, , int24 tickLower, int24 tickUpper, , , , , ) = positionManager.positions(
            positionID[poolID]
        );
        uint256 amount0;
        uint256 amount1;
        if (token == token0) {
            (amount0, amount1) = _withdraw(
                poolID,
                LiquidityAmounts.getLiquidityForAmount0(
                    TickMath.getSqrtRatioAtTick(tickLower),
                    TickMath.getSqrtRatioAtTick(tickUpper),
                    amount
                ),
                amount0Min,
                amount1Min
            );
        } else {
            (amount0, amount1) = _withdraw(
                poolID,
                LiquidityAmounts.getLiquidityForAmount1(
                    TickMath.getSqrtRatioAtTick(tickLower),
                    TickMath.getSqrtRatioAtTick(tickUpper),
                    amount
                ),
                amount0Min,
                amount1Min
            );
        }

        balances[poolID][token0] += amount0;
        balances[poolID][token1] += amount1;
    }

    function _withdraw(
        uint32 poolID,
        uint128 liquidity,
        uint256 amount0Min,
        uint256 amount1Min
    ) internal returns (uint256 amount0, uint256 amount1) {
        // Remove liquidity
        uint256 tokenId = positionID[poolID];
        (amount0, amount1) = positionManager.decreaseLiquidity(
            INonfungiblePositionManager.DecreaseLiquidityParams(
                tokenId,
                liquidity,
                amount0Min,
                amount1Min,
                block.timestamp
            )
        );

        // collect liquidity but leave the fees
        positionManager.collect(
            INonfungiblePositionManager.CollectParams(
                tokenId,
                address(this),
                SafeCast.toUint128(amount0),
                SafeCast.toUint128(amount1)
            )
        );
    }

    function createPool() external override onlyManager {
        poolIDCounter++;
        emit PoolCreated(poolIDCounter);
    }

    function harvestYieldByPool(
        uint32 poolID,
        SwapParams calldata token0Params,
        SwapParams calldata token1Params
    ) external override onlyManager {
        /**
         * 1. Collect owed tokens from the pool
         * 2. Everything should be fees, because we always claim our owed liquidity when withdrawing.
         *       A small amount of fees (any increment from when SwapParams were generated) may remain behind
         * 3. Liquidate any fees to WETH
         * 4. Account yield
         */
        require(poolID <= poolIDCounter, "invalid pool");
        uint256 tokenId = positionID[poolID];
        require(tokenId > 0, "pool has no position");

        (, , address token0, address token1, , , , , , , , ) = positionManager.positions(tokenId);
        (uint256 amount0, uint256 amount1) = positionManager.collect(
            INonfungiblePositionManager.CollectParams(
                tokenId,
                address(this),
                SafeCast.toUint128(token0Params.amountIn),
                SafeCast.toUint128(token1Params.amountIn)
            )
        );

        address wethAddress = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();
        uint256 wethYield;
        // we colelcted exactly the amount we want to trade, so there should not be any excess to account
        if (token0 != wethAddress) {
            if (amount0 != 0) {
                wethYield += _swapExactInput(token0Params);
            }
        } else {
            wethYield += amount0;
        }
        if (token1 != wethAddress) {
            if (amount1 != 0) {
                wethYield += _swapExactInput(token1Params);
            }
        } else {
            wethYield += amount1;
        }

        if (wethYield != 0) {
            availableYield[poolID][wethAddress] += wethYield;
        }
    }

    function exitPosition(CloseParams calldata params) external override onlyManager {
        uint256 position = positionID[params.poolID];
        require(position > 0, "pool has no position");
        require(params.poolID <= poolIDCounter, "invalid pool");
        (, , address token0, address token1, , , , uint128 liquidity, , , , ) = positionManager.positions(position);

        // Liquidate and burn current position
        (uint256 amount0, uint256 amount1) = _liquidatePosition(
            LiquidateParams(
                params.poolID,
                token0,
                token1,
                liquidity,
                position,
                params.decreaseAmount0Min,
                params.decreaseAmount1Min
            )
        );
        if (amount0 > 0) {
            balances[params.poolID][token0] += amount0;
        }
        if (amount1 > 0) {
            balances[params.poolID][token1] += amount1;
        }
    }

    function enterPosition(EnterParams calldata params) external override onlyManager {
        require(positionID[params.poolID] == 0, "position still open");
        require(params.poolID <= poolIDCounter, "Invalid pool");

        // Trade to get enough of the other half
        uint256 amount0 = balances[params.poolID][params.token0];
        uint256 amount1 = balances[params.poolID][params.token1];
        if (IERC20(params.token0).allowance(address(this), address(positionManager)) != type(uint256).max) {
            IERC20(params.token0).safeApprove(address(positionManager), 0);
            IERC20(params.token0).safeApprove(address(positionManager), type(uint256).max);
        }
        if (IERC20(params.token1).allowance(address(this), address(positionManager)) != type(uint256).max) {
            IERC20(params.token1).safeApprove(address(positionManager), 0);
            IERC20(params.token1).safeApprove(address(positionManager), type(uint256).max);
        }
        // Mint a new position and save position id
        (uint256 tokenId, , uint256 amount0Invested, uint256 amount1Invested) = positionManager.mint(
            INonfungiblePositionManager.MintParams(
                params.token0,
                params.token1,
                params.newFee,
                params.tickLower,
                params.tickUpper,
                amount0,
                amount1,
                params.amount0Min,
                params.amount1Min,
                address(this),
                block.timestamp
            )
        );
        positionID[params.poolID] = tokenId;
        balances[params.poolID][params.token0] -= amount0Invested;
        balances[params.poolID][params.token1] -= amount1Invested;
    }

    function _liquidatePosition(LiquidateParams memory params) internal returns (uint256 amount0, uint256 amount1) {
        positionManager.decreaseLiquidity(
            INonfungiblePositionManager.DecreaseLiquidityParams(
                params.position,
                params.liquidity,
                params.decreaseAmount0Min,
                params.decreaseAmount1Min,
                block.timestamp
            )
        );
        (amount0, amount1) = positionManager.collect(
            INonfungiblePositionManager.CollectParams(
                params.position,
                address(this),
                type(uint128).max,
                type(uint128).max
            )
        );
        // Any leftover fees just gets rolled into principal
        positionManager.burn(params.position);
        delete positionID[params.poolID];
    }

    function _swapExactInput(SwapParams memory swap) internal returns (uint256 amountOut) {
        _approveToken(swap.tokenIn, address(swapRouter), swap.amountIn);
        amountOut = swapRouter.exactInputSingle(
            IUniswapV3SwapRouter.ExactInputSingleParams(
                swap.tokenIn,
                swap.tokenOut,
                swap.fee,
                address(this),
                swap.amountIn,
                swap.amountOutMinimum,
                swap.sqrtPriceLimitX96
            )
        );
    }

    function _approveToken(
        address token,
        address spender,
        uint256 amount
    ) internal {
        uint256 allowance = IERC20(token).allowance(address(this), spender);
        if (allowance < amount) {
            if (allowance != 0) {
                IERC20(token).safeApprove(spender, 0);
            }
            IERC20(token).safeApprove(spender, type(uint256).max);
        }
    }

    /// Getter functions
    function getPoolBalance(uint32 poolID) external view override returns (uint256 tokenA, uint256 tokenB) {
        require(poolID > 0 && poolID <= poolIDCounter, "invalid pool");
        uint256 position = positionID[poolID];
        require(position > 0, "position is invalid");

        // Returns the uniswap pool balances
