            price,
            TickMath.getSqrtRatioAtTick(tickLower),
            TickMath.getSqrtRatioAtTick(tickUpper),
            liquidity
        );
    }

    /// @dev don't run this on chain!!!
    function getPendingYieldBurn(uint32 poolId)
        external
        override
        returns (address[] memory tokens, uint256[] memory amounts)
    {
        uint256 tokenId = positionID[poolId];
        (, , address token0, address token1, uint24 fee, int24 tickLower, int24 tickUpper, , , , , ) = positionManager
            .positions(tokenId);
        IUniswapV3Pool(factory.getPool(token0, token1, fee)).burn(tickLower, tickUpper, 0);
        (, , , , , , , , , , uint128 tokensOwed0, uint128 tokensOwed1) = positionManager.positions(tokenId);
        tokens = new address[](3);
        amounts = new uint256[](3);
        tokens[0] = token0;
        amounts[0] = uint256(tokensOwed0);
        tokens[1] = token1;
        amounts[1] = uint256(tokensOwed1);
        tokens[2] = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();
        amounts[2] = availableYield[poolId][tokens[2]];
    }

