    {}

    function getPool(uint32 poolID) external view override returns (PositionNFT memory pool) {
        (, , address token0, address token1, uint24 fee, int24 tickLower, int24 tickUpper, , , , , ) = positionManager
            .positions(positionID[poolID]);
        pool.fee = fee;
        pool.tickLower = tickLower;
        pool.tickUpper = tickUpper;
        pool.tokenA = token0;
        pool.tokenB = token1;
        pool.uniPool = factory.getPool(token0, token1, fee);
        pool.positionID = positionID[poolID];
    }

    function sortTokens(address tokenA, address tokenB) external pure returns (address token0, address token1) {
        (token0, token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
    }

    function getRawPoolData(uint32 poolID)
        external
        view
        override
        returns (
            address token0,
            address token1,
            uint24 fee,
            int24 tickLower,
            int24 tickUpper,
            uint128 liquidity,
            uint128 tokensOwed0,
            uint128 tokensOwed1
        )
    {
        (, , token0, token1, fee, tickLower, tickUpper, liquidity, , , tokensOwed0, tokensOwed1) = positionManager
            .positions(positionID[poolID]);
    }

    function getAmountMinimums(
        uint256 amount0,
        uint256 amount1,
        int24 tickLower,
        int24 tickUpper,
        uint160 currentPrice
    ) external pure returns (uint256 amount0Min, uint256 amount1Min) {
        uint160 priceLower = TickMath.getSqrtRatioAtTick(tickLower);
        uint160 priceUpper = TickMath.getSqrtRatioAtTick(tickUpper);
        uint128 liquidity = LiquidityAmounts.getLiquidityForAmounts(
            currentPrice,
            priceLower,
            priceUpper,
            amount0,
            amount1
        );
        (amount0Min, amount1Min) = LiquidityAmounts.getAmountsForLiquidity(
            currentPrice,
            priceLower,
            priceUpper,
            liquidity
        );
    }
}
